script: |
  super -f text -I q9326.spq | sort > q9326.out

inputs:
  - name: q9326.spq
    data: |
      SELECT DISTINCT - - col2 * col0 * - col2 + - col2 + + ( - 33 ) / + col0 AS col1 FROM tab1 (FORMAT parquet) AS cor0;
  - name: tab1

outputs:
  - name: q9326.out
    data: |
      -207993
      -737376
      -8813
